function App() {
  return (
    <div className="min-h-screen bg-gradient-to-br from-white to-blue-100 text-center p-10">
      <h1 className="text-4xl font-bold text-gray-800 mb-4">Alucentra Consulting</h1>
      <p className="text-lg text-gray-600">Tailwind CSS is working!</p>
    </div>
  );
}

export default App;
